import classes from "./Header.module.css"

const Header = () => {
    let man = {
        name: 'Aaa',
        age: 14,
        getName(){
            alert(this.name)
        }
    }
    console.log(man.name)
    console.log(man.age)
    man.getName()
    return (
        <header className={classes.header}>
            <div className={classes.header_logo}>
                <img src="https://i.pinimg.com/originals/ce/b8/63/ceb8632252376a23be9f689901b9e3d3.png"/>
            </div>
            <div className={classes.search}>
                <input type='text'/>
            </div>
        </header>
    );
};
export default Header;
